import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
 const mapRoutes = {
    "clue1" : <Clue1 /> ,
    "jiya": <Person1 />,

    "clue2" : <Clue2 />, 
    "saloni": <Person2 />,

    "clue3" : <Clue3 />, 
    "krish": <Person3 />, 

    "clue4" : [<Clue4 />, "person4"],
    "person4": [<Person4 />, "clue5"],
    "clue5" : [<Clue5 />, "person5"],
    "person5": [<Person5 />, "clue6"],
    "clue6" : [<Clue6 />, "person6"],
    "person6": [<Person6 />, "clue7"],
    "clue7" : [<Clue7 />, "person7"],
    "person7": [<Person7 />, "clue8"],
    "clue8" : [<Clue8 />, "person8"],
    "person8": [<Person8 />, "clue9"],
    "clue9" : [<Clue9 />, "person9"],
    "person9": [<Person9 />, "clue10"],
    "clue10" : [<Clue10 />, "person10"],
    "person10": [<Person10 />, "finalPage"],
  }

  const routeList = [];

  routeList.push(
    <Route path="/" element={<Home />} />
  )
  let str = "/"
  Object.entries(mapRoutes).forEach(([clueName, listDetais], index) => {
    str += clueName + '/'
    routeList.push(
      <Route path={str} element={listDetais[0]} />
    )
  });
function App() {
  return (
      <BrowserRouter>
      <Routes>
        {routeList}
      </Routes>
    </BrowserRouter>
  );
}

export default App;
